let format = (second) => {
  let min = ~~(second / 60)
  let sec = ~~(second % 60)
  if (min) {
    return min + ':' + sec
  } else {
    return sec
  }
}
Array.prototype.mm = function (key) {
  return this.map(o => o[key])
}
Array.prototype.mf = function (rgx) {
  return this.filter(o => { return o.match(rgx) })
}
Array.prototype.mfmt = function () {
  for (let key in this[0]) {
    this[key] = this.mm(key)
  }
  return this
}
Array.prototype.ms = function (key) {
  if (key) {
    return [...new Set(this.mm(key))]
  }
  return [...new Set(this)]
}


